import { View, StyleSheet, Modal, Button, Text } from "react-native";

const NoteModal = () => {
  function onChange() {
    return (
      <View>
        <Modal animationType={fade}>
          <Text>HOLA</Text>
        </Modal>
      </View>
    );
  }
  return (
    <View>
      <Button style={styles.button} onChange={onChange}></Button>
    </View>
  );
};

const styles = StyleSheet.create({
  button: {
    width: 100,
    height: 100
  }
});

export default NoteModal;
